// ==UserScript==
// @name         GKV hkk Anlegen Script
// @namespace    http://tampermonkey.net/
// @version      1.1
// @description  hkk GKV Anlegen
// @author       Malte Kretzschmar
// @match        https://bm.bp.vertrieb-plattform.de/bm/*
// @match        https://www.crm.vertrieb-plattform.de/betreuung/crm/hauptnavigation/kundendetails
// @grant        GM_setValue
// @grant        GM_getValue
// @require      https://cdn.jsdelivr.net/npm/pdf-lib/dist/pdf-lib.min.js
// @icon         https://www.google.com/s2/favicons?sz=64&domain=tecis.de
// ==/UserScript==

(async function() {
    'use strict';

    const currentURL = window.location.href;

    if (currentURL.includes("crm.vertrieb-plattform.de")) {

        // Wait for the collapsible element to appear
        const observer = new MutationObserver((mutations, observerInstance) => {
            const collapsibles = document.querySelectorAll('.sldo-cl-c-collapsible');
            if (collapsibles.length > 0) {
                observerInstance.disconnect(); // Stop observing once collapsibles are found

                // Initialize an empty JSON object
                const result = {};

                console.log('Number of collapsible sections found:', collapsibles.length);

                // Function to process visible sections
                function processSections(callback) {
                    const sections = document.querySelectorAll('dl.sldo-cl-o-grid');
                    console.log('Number of visible sections found:', sections.length);

                    sections.forEach((section, sectionIndex) => {
                        console.log(`Processing section ${sectionIndex + 1}`);

                        // For each section, find all pairs of key-value divs
                        const rows = section.querySelectorAll('.sldo-cl-o-grid__cell');

                        console.log(`  Number of rows found: ${rows.length}`);

                        rows.forEach((row, rowIndex) => {
                            const keyElement = row.querySelector('dt div');
                            const valueElement = row.querySelector('dd div');

                            if (keyElement && valueElement) {
                                let key = keyElement.textContent.trim();
                                const value = valueElement.textContent.trim();

                                console.log(`    Row ${rowIndex + 1} Key:`, key);
                                console.log(`    Row ${rowIndex + 1} Value:`, value);

                                // If the key already exists and value is identical, skip
                                if (result[key] === value) {
                                    console.log(`    Skipping duplicate key-value pair: ${key} - ${value}`);
                                    return;
                                }

                                // If the key already exists with a different value, append an index to the key
                                let originalKey = key;
                                let counter = 1;
                                while (result[key] && result[key] !== value) {
                                    key = `${originalKey}${counter}`;
                                    counter++;
                                }

                                result[key] = value;
                            } else {
                                console.log(`    Row ${rowIndex + 1} is missing key or value`);
                            }
                        });
                    });

                    // Callback to proceed to the next collapsible
                    if (callback) callback();
                }

                // Iterate through all collapsibles sequentially
                function processAllSectionsSequentially(index = 0) {
                    if (index >= collapsibles.length) {
                        console.log('Final JSON object:', result);
                        const jsonString = JSON.stringify(result);
                        console.log('JSON string:', jsonString);
                        GM_setValue("data", jsonString);
                        return;
                    }

                    console.log(`Clicking collapsible section ${index + 1}`);
                    collapsibles[index].click();

                    // Wait for the section to load, then process it
                    setTimeout(() => {
                        processSections(() => processAllSectionsSequentially(index + 1));
                    }, 200); // Adjust timeout as needed for your page's load speed
                }

                // Start processing all sections sequentially
                processAllSectionsSequentially();
            }
        });

        observer.observe(document.body, { childList: true, subtree: true });

    }
    else if (currentURL.includes("bm.bp.vertrieb-plattform.de")) {
        const { PDFDocument } = PDFLib;
        // Utility function to wait for an element to appear
        async function waitForElement(selector, timeout = 100000) {
            const startTime = Date.now();
            while (Date.now() - startTime < timeout) {
                const element = document.querySelector(selector);
                if (element) return element;
                await new Promise(resolve => setTimeout(resolve, 100)); // Wait 100ms before checking again
            }
            throw new Error(`Element not found for selector: ${selector}`);
        }

        // Wait for the header containing "Eigene Vorgänge"
        try {
            const header = await waitForElement('#page\\:center\\:content > h1');
            if (!header.textContent.includes('Eigene Vorgänge')) {
                console.log('Header does not contain "Eigene Vorgänge". Script not executed.');
                return;
            }
        } catch (error) {
            console.error(error.message);
            return;
        }
        // Find the parent element to append the new button
        const titleButtons = document.querySelector('#page\\:center\\:contentForm\\:titleButtons');
        if (!titleButtons) {
            console.error('Could not find the titleButtons element.');
            return;
        }

        // Create the new button
        const newButton = document.createElement('button');
        newButton.id = 'page:center:contentForm:reload';
        newButton.name = 'page:center:contentForm:reload';
        newButton.className = 'ui-button ui-widget ui-state-default ui-corner-all ui-button-text-only';
        newButton.tabIndex = 1000;
        newButton.type = 'submit';
        newButton.role = 'button';
        newButton.innerHTML = '<span class="ui-button-text ui-c">hkk Antrag anlegen</span>';

        // Append the button to the titleButtons element
        titleButtons.appendChild(newButton);

        // Bind functionality to the button
        newButton.addEventListener('click', async function (event) {
            event.preventDefault();

            async function performAction(action, retries = 3) {
                for (let attempt = 0; attempt < retries; attempt++) {
                    try {
                        await action();
                        return true; // Action succeeded
                    } catch (error) {
                        console.error(`Attempt ${attempt + 1} failed:`, error);
                        if (attempt < retries - 1) {
                            await new Promise((resolve) => setTimeout(resolve, 500)); // Wait before retrying
                        } else {
                            console.error("All retries failed.");
                            return false;
                        }
                    }
                }
            }

            async function sequentialExecution() {
                const wait = (ms) => new Promise((resolve) => setTimeout(resolve, ms));

                // Step 1
                await performAction(async () => {
                    document.querySelector("#page\\:center\\:contentForm\\:addVorgang > span").click();
                    await wait(200);
                });

                // Step 2
                await performAction(async () => {
                    // Find the menu item containing "Änderung/Erhöhung"
                    const menuItem = Array.from(document.querySelectorAll("span.ui-menuitem-text"))
                        .find(el => el.textContent.trim() === "Änderung/Erhöhung");

                    if (!menuItem) throw new Error('Menu item "Änderung/Erhöhung" not found.');

                    menuItem.click();
                    await wait(400);
                });

                // Step 3
                await performAction(async () => {
                    document.querySelector("#dialogForm0\\:chkbxNoGespraechsnotiz > div.ui-chkbox-box.ui-widget.ui-corner-all.ui-state-default").click();
                    await wait(100);
                });

                // Step 4
                await performAction(async () => {
                    document.querySelector("#dialogForm0\\:bezeichnung_input").value = "Krankenkassenwechsel 2025 hkk";
                    await wait(100);
                });

                // Step 5 - File upload (using Base64)
                await performAction(async () => {
                    const fileInput = document.querySelector("#dialogForm0\\:fileUpload_anschreibenantrag_input");
                    if (!fileInput) throw new Error("File input element not found.");

                    // region pdf
                    // Base64-encoded PDF (replace this placeholder with your actual Base64 string)
                    const pdfBase64 = "";

                    // endregion
                    // Utility function to convert Base64 string -> Blob
                    function base64ToBlob(base64, contentType = 'application/pdf') {
                        const byteCharacters = atob(base64);
                        const byteNumbers = new Array(byteCharacters.length);
                        for (let i = 0; i < byteCharacters.length; i++) {
                            byteNumbers[i] = byteCharacters.charCodeAt(i);
                        }
                        const byteArray = new Uint8Array(byteNumbers);
                        return new Blob([byteArray], {type: contentType});
                    }

                    // Convert Base64 into a Blob, then into a File object
                    var pdfBlob = base64ToBlob(pdfBase64, 'application/pdf');
                    try {
                        console.log("Trying");

                        const parsedData = JSON.parse(GM_getValue("data", null));
                        if(parsedData) {

                            const VName = parsedData.Vorname || "";
                            const Nachname = parsedData.Nachname || "";
                            const Strasse = parsedData["Straße / Nr."] || "";
                            const PLZ = parsedData["PLZ / Ort"] ? parsedData["PLZ / Ort"].slice(0, 5) : "";
                            const Ort = parsedData["PLZ / Ort"] ? parsedData["PLZ / Ort"].slice(6) : "";
                            const Geburtsort = parsedData.Geburtsort || "";
                            const Geburtsdatum = parsedData.Geburtstag || "";
                            const Geburtsland = parsedData.Geburtsland || "";
                            const Familienstand = parsedData.Familienstand || "";
                            const staats = parsedData.Staatsangehörigkeit || "";
                            const Arbeitgeber = parsedData.Arbeitgeber || "";
                            const AusgeuebteTaetigkeit = parsedData["Ausgeübte Tätigkeit"] || "";

// Handle multiple "Nummer" fields
                            let Sozialversicherungsnummer = "";
                            for (let index = 0; index <= 5; index++) {
                                const key = `Nummer${index === 0 ? '' : index}`;
                                if (parsedData[key] && /^\d{8}[A-Z]\d{3}$/.test(parsedData[key])) {
                                    Sozialversicherungsnummer = parsedData[key];
                                    break;
                                }
                            }

                            // Convert the Blob into an ArrayBuffer for PDFLib
                            const existingPdfBytes = await pdfBlob.arrayBuffer();

                            // Load the PDF with PDFLib
                            const pdfDoc = await PDFDocument.load(existingPdfBytes);

                            // Get the form so we can inspect its fields
                            const form = pdfDoc.getForm();

                            // Get all fields in the form
                            const fields = form.getFields();
                            console.log("Found fields:");
                            fields.forEach(field => {
                                console.log(`Field Name: ${field.getName()}`);
                            });

                            const nameField = form.getTextField('Name');
                            nameField.setText(Nachname);

                            const vorn = form.getTextField('Vorname');
                            vorn.setText(VName);

                            const Str = form.getTextField('Straße, Hausnr');
                            Str.setText(Strasse);

                            const plz = form.getTextField('PLZ');
                            plz.setText(PLZ);

                            const wo = form.getTextField('Wohnort');
                            wo.setText(Ort);

                            const go = form.getTextField('Geburtsort');
                            go.setText(Geburtsort);

                            const gl = form.getTextField('Geburtsland');
                            gl.setText(Geburtsland);

                            const gd = form.getTextField('Geburtsdatum');
                            gd.setText(Geburtsdatum);

                            const fz = form.getTextField('Familienstand');
                            fz.setText(Familienstand);

                            const sv = form.getTextField('RV-Nr');
                            sv.setText(Sozialversicherungsnummer);

                            const ag = form.getTextField('Name Arbeitgeber');
                            ag.setText(Arbeitgeber);

                            const at = form.getTextField('als');
                            at.setText(AusgeuebteTaetigkeit);



                            // Save the updated PDF
                            const newPdfBytes = await pdfDoc.save();

                            // Convert the updated PDF bytes back to a Blob
                            pdfBlob = new Blob([newPdfBytes], {type: 'application/pdf'});
                            console.log("Filled all fields");
                        }
                    } catch (err) {
                        console.warn("PDFLib form-fill step failed. Uploading original PDF without fields filled.", err);
                    }

                    const file = new File([pdfBlob], "hkk_Antrag_Arbeitnehmer_Berater.pdf", {type: pdfBlob.type});

                    // Attach the file to the input element
                    const dataTransfer = new DataTransfer();
                    dataTransfer.items.add(file);
                    fileInput.files = dataTransfer.files;
                    fileInput.dispatchEvent(new Event("change"));

                    await wait(200);
                });
            }

            // Execute the sequence
            sequentialExecution().catch(console.error);
        });
    }
})();
